	static short[] samples = null;
	static short average = 0;
	
	static short getAverage()
	{
		int a = 0;

		for(int i = 0; i < samples.length; ++i)
			a += samples[i];
		
		average = (short)(a / samples.length);
		return average;
	}

	static byte[] coef = { 1, 0, -3, 0, 4, 0, -3, 2, 3, -3, -2, 2, 3, -1, -3, 1 };
	
	static int getMatch(int start)
	{
		int match = 0;
		
		for(int i = start - 16; i < start; ++i)
		{
			short s = (short)(samples[i] - average);
			if( s >= 0 )
				match -= s;
			else
				match += s;
		}

		match <<= 2;
		
		for(int i = 0; i < 16; ++i)
		{
			short s = (short)(samples[start + i] - average);
			match += s * coef[i];
		}
		
		if( match < -1000 )
			match = -1000;

		return match;
	}
	
	static void analize(short[] samples)
	{
		TestRanging.samples = samples;
		
		System.out.println("length " + samples.length);
		System.out.println("average " + getAverage());

		for(int i = 16; i < samples.length - 15; ++i)
			System.out.println("" + samples[i] + "\t" + getMatch(i));
	}
	
	public static void main(String[] args)
	{
		analize(test1);
	}
